import React, { Component } from "react";
import "./experience .scss";
import axios from "axios";
import Navbar from "../../components/navbar/navbar";

export default class Experience extends Component {
  constructor(props) {
    super(props);

    // this.deleteProjects = this.deleteProjects.bind(this)

    this.state = { Projects: [] };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5003/project/")
      .then((response) => {
        this.setState({ Projects: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }
  render() {
    return (
      <div>
        <Navbar />
        <div className="cards6">
          {this.state.Projects &&
            this.state.Projects.map((item, index) => {
              return (
                <div >
                  <div class="main">
  <h1>An Animated Lil' Popup</h1>
  <p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Proin non rhoncus diam, a porta diam! Nunc ultricies risus quis convallis consequat! Phasellus dapibus tortor eu finibus tempor. Sed ut malesuada turpis, vitae luctus nisi. Suspendisse vitae libero sed libero eleifend convallis.</p>
  <a class="btn popup-btn" href="#">Click Me!</a>
</div>

<div class="popup-wrap">
    <div class="popup-box">
      <h2>Title of Popup</h2>
      <h3>A sub-heading for the popup with a little description.</h3>
      <a class="close-btn popup-close" href="#">x</a>
    </div>
  </div>
                </div> 
              );
            })}
        </div>
      </div>
    );
  }
}
